import React, { useState } from "react";
import Addnewvehicle from "./components/Addnewvehicle";
import Addvehicleentry from "./components/Addvehicleentry";

import "./Main.css";

const Temp = () => {
  const [modalOpen, setModalOpen] = useState(false);
  
    
function Add(){
  const result = (modalOpen === true ?  `${modalOpen && <Addvehicleentry setOpenModal={setModalOpen} />}`: "positive")
  document.write(result)
}

  return (
    <div className="Temp">
      <div className="container">
        <div className="subcontainer1">
          <h2>Toll Management Application</h2>
        </div>

        <div>
          <div class="left-btn">
            <label>Toll entries/vehicle entries</label>
            <button>filter</button>
            <input className="homeinput" placeholder="Search "></input>
          </div>
          <div class="right-btn">
            <button
              className="btn"
              onClick={result}
            >
              Add vehicle entry
            </button>
            <button className="btn" onClick={() => {
                setModalOpen(true);
              }}>Add new toll</button>
            <button className="btn3" onClick={() => {
                setModalOpen(true);
              }}>View all tolls</button>
          </div>
        </div>

        <br></br>
        <br></br>

        <table style={{ width: "100%" }}>
          <tr>
            <th style={{ width: "30%" }}>VEHICLE TYPE</th>
            <th>VEHICLE NUMBER</th>
            <th>DATE/TIME</th>
            <th>TOOL NAME</th>
            <th style={{ width: "20%" }}>TARRIF</th>
          </tr>
          <tr>
            <td>munna</td>
            <td>munna</td>
            <td>munna</td>
            <td>munna</td>
            <td>munna</td>
          </tr>
          <tr>
            <td>munna</td>
            <td>munna</td>
            <td>munna</td>
            <td>munna</td>
          </tr>
        </table>
      </div>

      {modalOpen && <Addvehicleentry setOpenModal={setModalOpen} />}
     
    </div>
  );
};

export default Temp;
